import React,{useEffect, Fragment} from 'react'
import{ connect }  from "react-redux";
import { getCurrentUserProfile } from '../../actions/profile';
import Spinner from "../layout/Spinner";
import { Link } from 'react-router-dom';
import PropTypes from 'prop-types'

function DashboardAction(props) {
    return (
        <div class="dash-buttons">
            <Link to="/update-profile" class="btn btn-light"
            ><i class="fas fa-user-circle text-primary"></i> Edit Profile</Link>
            <Link href="add-experience.html" class="btn btn-light"
            ><i class="fab fa-black-tie text-primary"></i> Add Experience</Link>
            <Link to="/dashboard" class="btn btn-light"
            ><i class="fas fa-graduation-cap text-primary"></i> Add Education</Link>
        </div>
    )
}

DashboardAction.propTypes = {

}

export default DashboardAction
